local function Scramble(String) -- thx ic3
	local Chars = string.split(String, '')

	for i = 1, #String do
		local R = math.floor(math.random() * (i)) + 1
		local tmp = Chars[i]

		Chars[i] = Chars[R]
		Chars[R] = tmp
	end

	return table.concat(Chars, '')
end

